import city from '../Assets/city.jpg'
import blackwhitecity from '../Assets/black-whitecity.jpg'


// Define your image data
let data_product = [
  {
    id: 1,
    name: 'Big colored city',
    image: city,
    new_price:400.00,
    old_price:800.00,
  },
  {
    id: 2,
    name: 'A black and white city',
    image: blackwhitecity,
    new_price:500.00,
    old_price:800.00,
  },
  // Add more image objects as needed
];

export default data_product;
